    <div id="startBox" onclick="start()">
        Click to start (this will take a while)
    </div>
    <div id="endBox">
        Congratulations! you finished. 
    </div>
<script>    
    var totalMaps = 12;
    var index = 1;
    var viewBoxes = [360, 500, 280, 1050, 175, 433, 750, 375, 900, 700, 325, 125, 100];
    var positions = [[279, 695], [249, 615], [156, 130], [372, 71], [-74, 378], [308, 682], [536, 386], [605, 719], [278, 205], [123, 446], [355, 801], [553, 954], [0, 0]] 
    //top , left
    var time = [0, 0] // minute, second
    var timerInterval;
    var hintlevel = 0;
    
    // document.getElementById("w" + index).display = "block";  
    document.getElementById("map").src = "images/waldo/m" + index + ".jpg"; 
    var svgElement = document.getElementById("sts")
    svgElement.setAttribute("viewBox", "0 0 " + viewBoxes[index -1] + " " + viewBoxes[index-1]);
    svgElement.style.top = positions[index -1][0] + "px";
    svgElement.style.left = positions[index -1][1] + "px";
    
    
    window.addEventListener("load", (event) => {
        document.getElementById("loadCircle").className = 'nothing';
    });


    for(let i = 1; i <= totalMaps; i++) {
        document.getElementById("w" + i).style.display = "none";
    }

    async function nextMap() {        
        document.getElementById("w" + index).style.display = "none";
        document.getElementById("loadCircle").className = 'loader';
        var svgElement = document.getElementById("sts")
        svgElement.setAttribute("viewBox", "0 0 " + viewBoxes[index] + " " + viewBoxes[index]);
        svgElement.style.top = positions[index][0] + "px";
        svgElement.style.left = positions[index][1] + "px";
        index++; 
        document.getElementById("map").src = "images/waldo/m" + index + ".jpg";
        document.getElementById("loadCircle").className = 'nothing';  
        document.getElementById("w" + index).style.display = "block";
    }
    
    function start() {
        document.getElementById("startBox").style.display = "none";
        document.getElementById("w1").style.display = "block";
        timerInterval = setInterval(() => {
            if(time[1] == 59) {
                time[0]++;
                time[1] = 0;
            } else {
                time[1]++;
            }
            if(time[1] < 10) {
                document.getElementById("timeDisplay").innerHTML = time[0] + ":0" + time[1];
            } else {
                document.getElementById("timeDisplay").innerHTML = time[0] + ":" + time[1];
            }
         }, 1000)
    }
    
    function end() {
        let finalTime = ""
        if(time[1] < 10) {
            finalTime = time[0] + ":0" + time[1];
        } else {
            finalTime = time[0] + ":" + time[1];
        }
        document.getElementById("w" + index).style.display = "none";
        document.getElementById("endBox").style.display = "block";
        clearInterval(timerInterval);
        document.getElementById("endBox").innerHTML= "Congratulations! you finished. <br> Your final time is  " + finalTime;
    }
    
    function hint() {
        if(hintLevel = 0) {
            document.getElementById("w" + index).style.fill = "rgb(255 0 0 / 50%);"
            document.getElementById("w" + index).style.stroke = "rgb(255 0 0);"
        } else if(hintLevel = 1) {
            document.getElementById("w" + index).style.fill = "rgb(0 255 0 / 100%);"
            document.getElementById("w" + index).style.stroke = "rgb(255 0 0);"
        }
        hint++;
    }
</script>
